42776726456783_263583061550465130_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=111\u0026_nc_ohc=VUCY2QqDk9YAX-QdJUr\u0026oh=9186d6094ca053ae44bdb643dd4e3e16\u0026oe=5E9E4E60","config_width":320,"config_height":320},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c180.0.719.719a/s480x480/89919202_642776726456783_263583061550465130_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=111\u0026_nc_ohc=VUCY2QqDk9YAX-QdJUr\u0026oh=fef92143da676ef5d846e37f715b7309\u0026oe=5EA32F3C","config_width":480,"config_height":480},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/c180.0.719.719a/s640x640/89919202_642776726456783_263583061550465130_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=111\u0026_nc_ohc=VUCY2QqDk9YAX-QdJUr\u0026oh=fa4fd458b9cbdbfb586115d4787e51ca\u0026oe=5E9B7598","config_width":640,"config_height":640}],"is_video":false,"accessibility_caption":"\u56fe\u7247\u4e2d\u53ef\u80fd\u6709\uff1a1 \u4f4d\u7528\u6237\u3001\u5750\u7740\u3001\u8f7f\u8f66\u548c\u6237\u5916"}},{"node":{"comments_disabled":false,"__typename":"GraphImage","id":"2265601411934977847","edge_media_to_caption":{"edges":[{"node":{"text":"So this is going to be an intimate message for all:\nExactly a year ago from this date, 3/15/2019, I was depressed, going through the motions everyday for the last 26 years of my life. Was unhappy in my relationship, distant myself from friends and family, used the gym to avoid people. On this day a year ago, I finally was fed up with all of that. I no longer wanted to be here in this earth, worrying about my body, how others portrayed me, was I ever good enough. So I decided I was going to end my life. I was done. I felt no hope, lost, and everything was meaningless to me. Right before I decided to take a hand full of pills, I decided  that, I have not tried everything to make my life better and worth living for. That I needed to stop running from my mental health issues and start facing them head on. I called @suicide_hotlineofficial for help. This is the day my life changed. Changed as I no longer was going to live this life for everyone else, but going to live this life for me. I would not be alive today without a few people who reached out before I made the action. @slangingiron for contacting me everyday to check on me, was the first to stop me in my tracks, thank you for caring about me more than I cared for myself in that moment. @ogweaktummy for being so supportive to me for the last 9 years, thank you for being the best friend I always needed. @elliottlord for calling my mom @amumof3 and me to get me out of where I was at. @amumof3 for helping me realize I had an eating disorder and supporting me going into a facility. There are many other people that have touched my life along the way, but today I am a completely different person than I was a year ago. I changed for the better. I am no longer in an abusive relationship, I am not longer deciding to coping with stress and life by taking in out on my body. I am happy, free, and love life more than ever. Do I still struggle, yes, but now I know how to effectively cope with living in this world. Thank you to all. I love all of you \u2764\ufe0f #edrecovery #anorexiarecover #strongwomen #empoweringwomen #abusesurvivor #life #happiness #joy #sunday #friends #family #strength #power #love #hope #sucideprevention"}}]},"shortcode":"B9xCHsBAf83","edge_media_to_comment":{"count":0},"taken_at_timestamp":1584300756,"dimensions":{"height":1350,"width":1080},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/89856139_116547856620641_7079712078094579821_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=105\u0026_nc_ohc=kUIgb3ESjdYAX80-l8G\u0026oh=6232b852d4de4a5caafa60683d7e57ca\u0026oe=5E9C49AC","edge_liked_by":{"count":1},"edge_media_preview_like":{"count":1},"owner":{"id":"1910130869"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.0
